import React from "react";
import { Link } from "react-router-dom";

const AdminSidebar = () => {
  return (
    <div className="sidebar">
      <Link to="/admin/dashboard">
        <i className="fas fa-tachometer-alt"></i> Dashboard
      </Link>
      <Link to="/admin/view-products">
        <i className="fas fa-box-open"></i> View Products
      </Link>
      <Link to="/admin/create-product">
        <i className="fas fa-plus-square"></i> Create Product
      </Link>
      <Link to="/admin/view-categories">
        <i className="fas fa-list"></i> View Categories
      </Link>
      <Link to="/admin/create-category">
        <i className="fas fa-plus-circle"></i> Create Category
      </Link>
    </div>
  );
};

export default AdminSidebar;
